@alexander-doroshko : looking at the where this error is created, I wonder if the issue isn't that we're creating the file in a separate process and need to do a file system refresh to pick it up?

In other words,  maybe the `findChild(...)` call here

```
    final VirtualFile dotPackagesFile = pubspecFile.getParent().findChild(DotPackagesFileUtil.DOT_PACKAGES);

    if (dotPackagesFile == null) {
      return createProblemDescriptors(manager, psiFile, pubspecFile, DartBundle.message("pub.get.never.done"));
    }
```

should be replaced with a call to `LocalFileSystem.getInstance().refreshAndFindFileByPath(...)`?

May be introduce setter like `DartPubActionBase#setPubIsInProgress(boolean)` and use it in flutter plugin like:

```
try {
  DartPubActionBase.setPubIsInProgress(true);
  flutterCreate();
}
finally {
    DartPubActionBase.setPubIsInProgress(false);
}
```
